import React from 'react';
import Chatbot from '../components/Chatbot';

function ChatbotPage() {
  return (
    <div className="flex flex-col items-center p-8 min-h-screen bg-cover bg-center" style={{ backgroundImage: "url('/images/chatbot-bg.jpg')" }}>
      <h1 className="text-3xl font-bold text-white mb-6">Chat with your Support Bot</h1>
      <Chatbot />
    </div>
  );
}

export default ChatbotPage;
